from app.mktcore.mdlimports import *


class MKT_ASSET_AMENDMENT(exmodel):
	ID 									= db.Column(db.String(15), primary_key=True)
	AssetID 							= db.Column(db.String(15))
	EffectivePeriod 					= db.Column(db.String(2))
	Currency 							= db.Column(db.String(3))
	OldSerialNumber 					= db.Column(db.String(35))
	NewSerialNumber 					= db.Column(db.String(35))
	OldDescription 						= db.Column(db.String(100))
	NewDescription 						= db.Column(db.String(100))
	OldFrequency 						= db.Column(db.String(10))
	NewFrequency 						= db.Column(db.String(10))
	OldDepreciationMethod 				= db.Column(db.String(50))
	NewDepreciationMethod 				= db.Column(db.String(50))
	OldUnitOfProOrHourOfOpr 			= db.Column(db.Numeric(25,9))
	NewUnitOfProOrHourOfOpr 			= db.Column(db.Numeric(25,9))
	OldWholeLifeUnitOfProOrHourOfOpr 	= db.Column(db.Numeric(25,9))
	NewWholeLifeUnitOfProOrHourOfOpr 	= db.Column(db.Numeric(25,9))
	OldValueDate						= db.Column(db.String(10))
	NewValueDate						= db.Column(db.String(10))
	OldAssetLife						= db.Column(db.String(11))
	NewAssetLife						= db.Column(db.String(11))
	OldCrAccount						= db.Column(db.String(20))
	NewCrAccount						= db.Column(db.String(20))
	OldSalvageValue 					= db.Column(db.Numeric(25, 9))
	NewSalvageValue 					= db.Column(db.Numeric(25, 9))
	OldPaymentMethod					= db.Column(db.String(3))
	NewPaymentMethod					= db.Column(db.String(3))
	Transaction 						= db.Column(db.String(3))
	OldPurchasePriceUnits 				= db.Column(db.Numeric(25, 9))
	NewPurchasePriceUnits 				= db.Column(db.Numeric(25, 9))
	AmendDate 							= db.Column(db.String(10))
	Note 								= db.Column(db.String(100))



